import React, { Component } from 'react';
import Spinner from 'react-bootstrap/Spinner';
import Nav from 'react-bootstrap/Nav'
import { Link } from 'react-router-dom';
import Table from 'react-bootstrap/Table';
import { patho } from '../services/vep.service';

import { parseVEP } from '../helpers/vep-parser'

class Vep extends Component {

    constructor(props) {
        super(props);

        this.state = {
            isShow: false,
            user: {},
            data: [],
            chromosome: {},
            hgsvG: {}
        };

    }

    componentDidMount() {
        this.setState({ 
            user: JSON.parse(localStorage.getItem('user')),
            data: [],
            dataLoading: true,
            chromosome: this.props.chromosome,
            hgsvG: this.props.hgsvG
        });

        this.updatePatho = this.updatePatho.bind(this);
    }

    updatePatho = () => {
        const { chromosome, hgsvG } = this.state

        console.log(chromosome)
        console.log(hgsvG)

        patho.getPathogenicity(chromosome, hgsvG).then(data => {
            parseVEP(data).then((results) => {
                console.log(results)
                this.setState({ data: results.results })
            })
        }).then(() => {
            this.setState(state => ({ dataLoading: !state.dataLoading }));
        })
    }

    render() {
        const { data, dataLoading } = this.state;
        // Clinvar API Returns: AminoAcidChange,Chromosome,GeneSymbol,phenotype,NucleotideChange

    return (
        <div>
            <button onClick={this.updatePatho} type="button">
                Get VEP for {String(this.props.hgsvG).substring(0,15)}
            </button>

        {!dataLoading && 
            <div>
                <h2>VEP Results</h2>

                <div>
                    {data.map((value, index) => (
                        <div>
                            {
                            value.exists ?
                            <div>
                                {index}. {transcript_id}
                                {value.metaSVM &&
                                    <li>metaSVM {value.metaSVM} ({value.metaSVM_prediction})</li>}
                                {value.sift_score &&
                                    <li>SIFT score {value.sift_score} ({value.sift_prediction})</li>}
                                {value.polyphen_score &&
                                    <li>polyphen_score {value.polyphen_score} ({value.polyphen_prediction})</li>}
                                {value.cadd_raw &&
                                    <li>cadd_raw {value.cadd_raw}</li>}
                                {value.polyphen2_hdiv_score &&
                                    <li>polyphen2_hdiv_score {value.polyphen2_hdiv_score}</li>}
                                {value.metalr_score &&
                                    <li>metalr_score {value.metalr_score} ({value.metalr_prediction})</li>}
                            </div>
                            :
                            JSON.stringify(value)
                            }
                        </div>
                    ))
                    }
                </div>
            </div>
            }

        </div>
    );
    }
}

export { Vep };
